import React from "react";
import Navigation from "../../../global-components/Navigation/Navigation";
import PageStyles from "../styles/global-styles.scss";
import Grid from "@mui/material/Grid";

function ServicePage() {
  return (
    <div className={PageStyles.page_wrapper}>
      <Navigation color="primary" pageName={"Okko"} />
      <div className={PageStyles.basicInfoWrapper}>
        <div>
          <h1>Okko: онлайн кинотеатр</h1>
          <p>Фильмы и сериалы в отличном качестве</p>
        </div>

        <div>
          <div>кешбек 10 %</div>
          <div>30 дней за 1 ₽</div>
        </div>
      </div>
    </div>
  );
}

export default ServicePage;
